import hiking from "./imgs/hiking.jpg";
import skating from "./imgs/skating.jpg";
import canoeing from "./imgs/canoeing.jpg";
import kSkiing from "./imgs/kSkiing.jpg";
import aSkiing from "./imgs/aSkiing.jpg";
import snowshoeing from "./imgs/snowshoeing.jpg";

const Excursion = ({ excursion }) => {

    return (

        <div className='excursionBlock'>
            <div className='excursionImg'>
                if(imgUrl == hiking){
                    <img src={hiking}/>
                }
                if(imgUrl == skating){
                    <img src={skating}/>
                }
                if(imgUrl == canoeing){
                    <img src={canoeing}/>
                }
                if(imgUrl == kSkiing){
                    <img src={kSkiing}/>
                }
                if(imgUrl == aSkiing){
                    <img src={aSkiing}/>
                }
                if(imgUrl == snowshoeing){
                    <img src={snowshoeing}/>
                }

            </div>

            <div className='excursion'>
                <div className='excursionTitle'>
                    <h2>{excursion.title}</h2>
                </div>
                <div className='excursionDetails'>
                    <h4>Cost: ${excursion.cost}</h4>
                    <h4>Duration: {excursion.duration}</h4>
                </div>
                <div className='excursionDescription'>
                    <p>{excursion.tag}</p>
                </div>
                <div className='moreButton'>
                    <button>Learn More</button>
                </div>

            </div>
        </div>

    )
  }

  export default Excursion
